import BreadCrumb from '../components/BreadCrumb'
import { Link } from 'react-router-dom';
import { Helmet } from 'react-helmet';
const BidStore = () => {
  return ( <>
  <Helmet>
    <meta charSet='utf-8' />
    <title></title>
  </Helmet>
  <BreadCrumb title = 'Our Store' />
  </>
  );
}

export default BidStore
